import React from 'react';
import Header from './Header';
import Featured from './Featured';
import VideoList from './VideoList';
import Footer from './Footer';
import './styles.css';

function App() {
  return (
    <div className="App">
      <Header />
      <Featured />
      <VideoList />
      <Footer />
    </div>
  );
}

export default App;
